(2, 'Watkins M. Abbitt, Jr.', 'Abbitt, Watkins', 'Del. Watkins Abbitt (I-Appomattox)', 'wmabbitt', 'abbitt', 'house', 59, '1986-01-01', '2012-01-10', 'I', 'Though Del. Abbitt is a Republican -- he votes with Republicans and caucuses with Republicans -- he labels himself as an independent.  This may well come from his recognition that his political reputation is inherited from the long-lived political career of his father, Watkins Abbitt Sr., who represented the area in the U.S. House of Representatives as a Democrat for 25 years.', NULL, 'white', 'male', NULL, NULL, '804-698-1059', 'P.O. Box 683, Appomattox, VA 24522', NULL, 'DelWAbbitt@house.virginia.gov', NULL, NULL, NULL, NULL, 1, 'Appomattox', -78.8262, 37.3554, NULL, 63, '2018-01-05 03:19:36', '2006-08-08 11:46:42'),
(3, 'David J. Toscano', 'Toscano, David', 'Del. David Toscano (D-Charlottesville)', 'djtoscano', 'toscano', 'house', 197, '2006-01-01', NULL, 'D', 'David Toscano is an attorney specializing in family and real estate law. The Syracuse native holds degrees from Colgate, Boston College, and the University of Virginia. He served on the Charlottesville City Council from 1990-2002. He is married and has a son.', '0000-00-00', 'white', 'male', NULL, NULL, '804-698-1057', '211 E. High Street, Charlottesville, VA 22902', NULL, 'DelDToscano@house.virginia.gov', 'http://www.davidtoscano.com/', NULL, 'deltoscano', 'CC-12-00951', 188, 'Charlottesville', -78.4795, 38.0328, 'O:8:"stdClass":1:{s:4:"List";N;}', 45, '2018-01-05 03:19:36', '2006-08-08 11:46:42'),
