(61, 'Aston Donald McEachin', 'McEachin, Don', 'Sen. Don McEachin (D-Richmond)', 'admceachin', 'mceachin', 'senate', 249, '2008-01-09', '2017-01-08', 'D', 'Attorney at the McEachin Law Firm. Represented the 74th House District from 1996-2001, when he stepped down to run for attorney general. After losing the race to Republican Jerry Kilgore he regained the seat via a primary victory and was reelected in 2005. He helding the seat for a single term before moving up to the senate by defeating <a href="/legislator/bjlambert/">Sen. Benny Lambert</a> in the Democratic primary. Received his BS from American University and his JD from the University of Virginia. Married with three daughters.', '1961-10-10', 'black', 'male', 'Del. McEachin served in the House from 1996-2002, but stepped down to run for Attorney General.  He won his seat back in 2006.', '804-288-3381', '804-698-7509', '719 Nine Mile Road, Richmond, VA 23223', NULL, 'district09@senate.virginia.gov', 'http://www.donaldmceachin.com/', NULL, NULL, 'CC-12-00076', 73, 'Richmond', -77.3904, 37.5439, 'O:8:"stdClass":1:{s:4:"List";N;}', 34, '2018-01-05 03:19:36', '2006-11-19 15:09:59'),
