(308, 'Jill Holtzman Vogel', 'Vogel, Jill Holtzman', 'Sen. Jill Holtzman Vogel (R-Winchester)', 'jhvogel', 'vogel', 'senate', 267, '2008-01-09', NULL, 'R', 'Shenandoah Valley native. Practicing campaign finance attorney. One of the team of attorneys who represented the Bush-Cheney campaign in the Florida recount in 2000. Former Chief Counsel of the Republican National Committee. Received her BA in government and religion from William and Mary and her JD from DePaul University. Married with four children.', NULL, 'white', 'female', NULL, '540-662-4551', '804-698-7527', '117 East Picadilly Street, Suite 100-B, Winchester VA 22601', NULL, 'district27@senate.virginia.gov ', 'http://www.votejill.com/', NULL, 'JillHVogel', 'CC-12-00051', 79, 'Winchester', -78.1623, 39.1858, 'O:8:"stdClass":1:{s:4:"List";N;}', 62, '2018-01-05 03:19:36', '2007-11-17 16:16:12'),
(309, 'Richard H. Stuart', 'Stuart, Richard', 'Sen. Richard Stuart (R-Westmoreland)', 'rhstuart', 'stuart', 'senate', 268, '2008-01-09', NULL, 'R', 'Attorney for the Westmoreland County School Board. Former Westmoreland County commonwealth''s attorney. Eight year Marine Corps Reserve veteran. Attended the T.C. Williams School of Law, Virginia Wesleyan College, and Cambridge. Married with three children.', NULL, 'white', 'male', NULL, '804-493-8892', '804-698-7528', 'P.O. Box 1146, Montross, VA 22520', NULL, 'richard@stuartforsenate.com', 'http://www.stuartforsenate.com/', NULL, 'RichardStuartVA', 'CC-12-00084', 78, 'Westmoreland', -76.823, 38.093, 'O:8:"stdClass":1:{s:4:"List";N;}', 63, '2018-01-05 03:19:36', '2007-11-17 17:44:40'),
(310, 'John Chapman Petersen', 'Petersen, Chap', 'Sen. Chap Petersen (D-Fairfax)', 'jcpetersen', 'petersen', 'senate', 274, '2008-01-09', NULL, 'D', 'Attorney practicing business law with Surovell, Markle, Isaacs & Levy, PLC. Fairfax native. Elected to Fairfax City Council in 1998. Member of the House of Delegates from 2001-5, resigned his seat to seek unsuccessfully the Democratic nomination for Lt. Governor. Graduate of the University of Virginia and Williams College. Married with three children.', '1968-03-27', 'white', 'male', NULL, NULL, NULL, 'P.O. Box 1066, Fairfax, VA 22038', NULL, 'info@fairfaxsenator.com', 'http://www.fairfaxsenator.com/', NULL, 'ChapPetersen', 'CC-12-01095', 76, 'Fairfax', -77.3082, 38.8414, 'O:8:"stdClass":1:{s:4:"List";N;}', 34, '2017-09-17 01:48:37', '2007-11-17 17:46:48'),
