(319, 'Joseph D. Morrissey', 'Morrissey, Joe', 'Del. Joe Morrissey (I-Highland Springs)', 'jdmorrissey', 'morrissey', 'house', 214, '2008-01-09', '2015-03-25', 'I', 'Delegate Morrissey served as Richmond commonwealth''s attorney from 1989-1993. He holds a BA in economics from the University of Virginia, a JD from Georgetown and an Master of Laws from Trinity College (Dublin). He has three children. A Democrat, in 2014 he was convicted of contributing to the delinquency of a minor, leading him to resign his seat, run for reelection as an independent, and win his seat again.', '1957-09-23', 'white', 'male', NULL, '804-328-1466', '804-698-1074', '605 East Nine Mile Road, Highland Springs, VA 23075', NULL, 'DelJMorrissey@house.virginia.gov', 'http://joemorrisseyfordelegate.com/', 'http://joemorrisseyfordelegate.com/rss.xml', NULL, 'CC-12-01235', 201, 'Highland Springs', -77.3239, 37.5421, 'O:8:"stdClass":8:{s:9:"AccountId";s:36:"20dad76f-50cf-e111-b0b8-984be103f032";s:13:"CommitteeCode";s:11:"CC-12-01235";s:13:"CommitteeName";s:24:"Friends of Joe Morrissey";s:13:"CandidateName";s:20:"Joseph Dee Morrissey";s:13:"CommitteeType";s:28:"Candidate Campaign Committee";s:7:"Reports";O:8:"stdClass":4:{s:1:"0";O:8:"stdClass":10:{s:9:"DateFiled";s:10:"2013-06-03";s:13:"Contributions";s:9:"$8,037.80";s:13:"EndingBalance";s:10:"$68,616.86";s:3:"Url";s:52:"http://cfreports.sbe.virginia.gov/Report/Index/18606";s:2:"Id";s:5:"18606";s:11:"PeriodStart";s:10:"2013-04-01";s:9:"PeriodEnd";s:10:"2013-05-29";s:6:"XmlUrl";s:56:"http://cfreports.sbe.virginia.gov/Report/ReportXML/18606";s:6:"PdfUrl";s:56:"http://cfreports.sbe.virginia.gov/Report/ReportPDF/18606";s:7:"api_url";s:53:"http://openva.com/campaign-finance/reports/18606.json";}s:1:"1";O:8:"stdClass":10:{s:9:"DateFiled";s:10:"2013-04-15";s:13:"Contributions";s:10:"$11,295.00";s:13:"EndingBalance";s:10:"$71,852.24";s:3:"Url";s:52:"http://cfreports.sbe.virginia.gov/Report/Index/16506";s:2:"Id";s:5:"16506";s:11:"PeriodStart";s:10:"2013-01-