(324, 'Albert C. Pollard, Jr.', 'Pollard, Albert', 'Del. Albert Pollard (D-Lively)', 'acpollard', 'pollard', 'house', 99, '2008-02-20', '2012-01-10', 'D', 'Pollard held the seat from 2000-2005 before stepping down and running (unsuccessfully) for state senate, though regained his seat after his replacement won election to the U.S. House of Representatives.\r\n\r\nHe holds a degree in urban planning from Virginia Commonwealth University. Pollard is married and has three young children.', '1967-09-18', 'white', 'male', '', NULL, '804-698-1099', 'PO Box 508, Lively, VA 22507', NULL, 'DelAPollard@house.virginia.gov ', 'http://www.albertpollard.com/', 'http://www.problemsofparallax.com/feeds/posts/defaul', NULL, NULL, 132, 'Lively', -76.54, 37.73, NULL, 63, '2018-01-05 03:19:36', '2008-02-20 19:10:46'),
(325, 'Rev. Delores L. McQuinn', 'McQuinn, Delores', 'Del. Delores McQuinn (D-Richmond)', 'dlmcquinn', 'mcquinn', 'house', 210, '2009-01-14', NULL, 'D', 'McQuinn studied at Virginia Commonwealth University and Virginia Union University. She is an associate minister at Mount Olivet Baptist Church in Richmond. Previously a member of the Richmond City Council and the Richmond School Board, McQuinn was elected to the House in a special election after Del. Dwight Jones was elected Richmond mayor.', NULL, 'black', 'female', NULL, NULL, '804-698-1070', '900 North 35th Street, Richmond VA 23223', NULL, 'DelDMcQuinn@house.virginia.gov ', NULL, NULL, NULL, 'PP-12-01023', 207, 'Richmond', -77.4044, 37.5311, 'O:8:"stdClass":1:{s:4:"List";N;}', 30, '2018-01-05 03:19:36', '2009-01-08 22:48:41'),
