(354, 'Gordon C. Helsel, Jr.', 'Helsel, Gordon', 'Del. Gordon Helsel (R-Poquoson)', 'gchelsel', 'helsel', 'house', 231, '2011-03-09', NULL, 'R', 'A Tidewater native, Gordon Helsel is a Vietnam veteran—he earned two Purple Hearts and a Bronze Star—who owned and operated the York Box and Barrel Manufacturing Company until his 2001 retirement. He was the mayor of Poquoson at the time of his election to the General Assembly, a position that he''d held since 1996. He was first elected to the Poquoson Council in 1982. Helsel holds an associate''s degree in Occupational Safety and Health from Thomas Nelson Community College. He''s married, with two grown sons.', '1947-01-09', 'white', 'male', NULL, '757-969-9036', '804-698-1091', 'P. O. Box 2571, Poquoson VA 23662', NULL, 'DelGHelsel@house.virginia.gov ', 'http://www.gordonhelsel.com/', NULL, 'GordonHelsel', 'CC-12-00921', 233, 'Poquoson', -76.3461, 37.1224, 'O:8:"stdClass":1:{s:4:"List";N;}', 65, '2018-01-05 03:19:36', '2012-02-14 20:11:19'),
